// eslint-disable-next-line
import { Link } from 'react-router-dom';
import Navbar from './Navbar';

const About = () => {
  return (
    <div>
      <Navbar />
      <div className="container mx-auto">
        <div className="mt-8">
          <h2 className="text-2xl font-bold mb-4">About</h2>
          <div className="carousel slide" data-bs-ride="carousel">
            <div className="carousel-inner">
              <div className="carousel-item active">
                <img src="../static/about-bg.jpg" className="d-block w-100" alt="About Background" />
                <div className="carousel-caption d-none d-md-block">
                  <h5>About Me</h5>
                  <p>Some representative placeholder content for the first slide.</p>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div className="mt-8">
          <p className="lead">Lorem ipsum, dolor sit amet consectetur adipisicing elit. Ipsam ea, quam tempora quibusdam, ullam ex consequuntur illum dolor cum, aperiam illo obcaecati facere voluptatibus? Voluptas deserunt accusamus eius! Quo velit culpa obcaecati.</p>
        </div>
      </div>
    </div>
  );
};

export default About;
